  function injectLogoutIntoSidebar() {
    try {
      // Only show logout when user is authenticated
      var isLoggedIn = false;
      try { if (window.firebase && firebase.auth && typeof firebase.auth === 'function') { isLoggedIn = !!firebase.auth().currentUser; } } catch(_){}

      var container = document.getElementById('sidebarContainer');
      if (!container) return false;
      var list = container.querySelector('#sidebar ul') || container.querySelector('ul');
      if (!list) return false;

      var existing = list.querySelector('.logout-item, #logoutSideLink');
      if (!isLoggedIn) { // not logged-in: ensure it's hidden/removed
        try { if (existing) existing.parentElement && existing.parentElement.remove(); } catch(_){}
        return false;
      }
      if (existing) return true;

      var li = document.createElement('li');
      li.className = 'logout-item';

      var icon = document.createElement('i');
      icon.className = 'fa-solid fa-right-from-bracket';
      icon.setAttribute('aria-hidden','true');

      var a = document.createElement('a');
      a.href = '#';
      a.id = 'logoutSideLink';
      a.textContent = 'تسجيل الخروج';

      li.appendChild(icon);
      li.appendChild(a);

      li.addEventListener('click', function (e) {
        try { if (e && e.preventDefault) e.preventDefault(); } catch(_){}
        try { if (window.firebase && firebase.auth) { firebase.auth().signOut().catch(function(){}); } } catch(_){}
        try { localStorage.removeItem('sessionKeyInfo'); } catch(_){}
        try { localStorage.removeItem('session_fallback'); } catch(_){}
        try { sessionStorage.removeItem('sessionKeyInfo'); } catch(_){}
        try { sessionStorage.removeItem('session_fallback'); } catch(_){}
        try {
          var sidebar = container.querySelector('#sidebar');
          if (sidebar && sidebar.classList) sidebar.classList.remove('active');
        } catch(_){}
        try { window.location.href = 'login.html'; } catch(_){}
      });

      list.appendChild(li);
      return true;
    } catch(_) { return false; }
  }

